/**
 * @param {string} word
 * @return {number}
 */
var numDifferentIntegers = function (word) {
	const nums = {};
	let num = "";

	const newNum = () => {
		if (num === "") return;
		let i = 0;
		while (num[i] === "0") i++;
		num = num.slice(i);
		nums[num] = 1;
		num = "";
	};

	for (const ch of word) {
		if (+ch < 10) num = num + ch;
		else newNum();
	}

	newNum();
	console.log(nums);
	return Object.keys(nums).length;
};

numDifferentIntegers(
	""
);
